/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
    let currLen = 0
    let maxLen = 0
    let maxIdx = 0
    let startIdx = 0
    let repeat = {}
    const len = s.length
    let i = 0
    while (i < len) {
        let j = i
        while (j <= len) {
            let firstRIdx = repeat[s[j]]
            if (firstRIdx != null || j === s.length) {
                if (currLen > maxLen) {
                    maxLen = currLen
                    maxIdx = startIdx
                }
                for (let k = startIdx; k <= firstRIdx; ++k) {
                    repeat[s[k]] = null
                }

                startIdx = firstRIdx + 1
                i = j
                currLen = i - startIdx

                break
            } else {
                repeat[s[j]] = j
                ++currLen
            }
            ++j
        }

        if (j >= len) {
            break
        }
    }
    return maxLen

};

// 这个解法会超时
var lengthOfLongestSubstring2 = function (s) {
    let currLen = 0
    let maxLen = 0
    let maxIdx = 0
    let repeat = {}
    const len = s.length
    let i = 0
    while (i < len) {
        let j = i
        currLen = 0
        repeat = {}
        while (j <= len) {
            if (repeat[s[j]] != null || j === s.length) {
                if (currLen > maxLen) {
                    maxLen = currLen
                    maxIdx = i
                }
                i = ++repeat[s[j]]
                break
            } else {
                repeat[s[j]] = j
                ++currLen
            }
            ++j
        }

        if (j >= len) {
            break
        }
    }
    return maxLen

};


